        return (
        <div>
             <Movie name='Godzilla vs Kong' language='English' image='https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcT27-82NQhl-Sz9UWgIVuQNdcF812gk2R2DhCvVpMtUhS4kBfJHH4vKjlNaPH6818McyHU&usqp=CAU'/>
             <Movie name='TAILGATE' language='English' image='https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcRp2LwIADpvV3sw1aTE962FWZuAGn8rmiD_1W-OxPf5QjrXVERpZOGjs6iI_S2DSG2iRgM&usqp=CAU'/>

        </div>
    );
    }
}
export default Movies;
